pragma solidity ^0.4.25;

contract PZToken {

    address public                          addrAdmin;
    address public                          addrChest;

    constructor() public
    {
        addrAdmin = msg.sender;
    }

    function() payable public
    {

    }

    modifier onlyAdmin()
    {
        require(msg.sender == addrAdmin);
        _;
    }

    // function setChestAddr(address _addrChest) public onlyAdmin
    // {
    //     require(_addrChest != address(0x0));
    //     addrChest = _addrChest;
    // }

    function transferToken(address toAddress, uint256 tokenValue, trcToken id) payable public
    {
        toAddress.transferToken(tokenValue, id);
    }

    function msgTokenValueAndTokenId() public payable returns(trcToken, uint256)
    {
        trcToken id = msg.tokenid;
        uint256 value = msg.tokenvalue;
        return (id, value);
    }

    function getTokenBalance(address accountAddress, trcToken id) public view returns (uint256)
    {
        return accountAddress.tokenBalance(id);
    }

    function tokenTest() external view returns (address) {
        return addrAdmin;
    }
}
